import React, { useEffect, useState } from "react";
import { listJobs } from "../api";

export default function Dashboard({ token }) {
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
    if (!token) return;
    listJobs().then(data => setJobs(data.jobs || [])).catch(console.error);
  }, [token]);

  return (
    <div style={{ padding: 20 }}>
      <h2>Latest Jobs</h2>
      <table style={{ width: "100%", borderCollapse: "collapse" }}>
        <thead>
          <tr><th>Role</th><th>Company</th><th>Location</th><th>Published</th><th>Apply</th></tr>
        </thead>
        <tbody>
          {jobs.length === 0 ? (
            <tr><td colSpan={5}>No jobs found.</td></tr>
          ) : jobs.map((j, i) => (
            <tr key={i}>
              <td>{j.title}</td>
              <td>{j.company || "—"}</td>
              <td>{j.location}</td>
              <td>{j.published}</td>
              <td><a href={j.url} target="_blank" rel="noreferrer">Apply</a></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
